theme.customCss:
.typebot-chat-view > .flex:first-child {
    padding-top: 30px;
}

.typebot-button {
    background-color: #135E54!important;
    border: 1px solid #135E54!important;
}

.typebot-guest-bubble {
    background-color: #C71C00!important;
}

.typebot-input {
    position: fixed;
    bottom: 0;
    align-items: center;
    z-index: 999;
    right: 0;
}

.typebot-input .typebot-button {
    background: #008a7c;
    border-radius: 50%;
    color: #fff;
    position: relative;
    width: 50px;
    height: 50px;
    display: flex;
    align-items: center;
    justify-content: center;
}

.typebot-container {
    background-size: initial!important;
    background-repeat: repeat-x!important;
}

.typebot-host-bubble>.bubble-typing {
  border-radius: 0 5px 5px 5px;
}

.typebot-host-bubble>.bubble-typing:after {
    position: absolute;
    content: "";
    width: 0;
    height: 0;
    border-style: solid;
    border-width: 0px 10px 10px 0;
    border-color: transparent #fff transparent transparent;
    top: 0;
    left: -10px;
}

.typebot-guest-bubble {
  position: relative;
  border-radius: 5px 0 5px 5px;
}

.typebot-guest-bubble:after {
  position: absolute;
  content: "";
  width: 0;
  height: 0;
  border-style: solid;
}

.typebot-guest-bubble:after {
    border-width: 0px 0 10px 10px;
    border-color: transparent transparent transparent #C71C00;
    top: 0;
    right: -10px;
    border-style: solid;
}

iframe[src=""] {
  position: fixed;
  top: 0;
  left: 0;
  display: relative;
  width: 100%;
  height: 100% !important;
  z-index: 999999;
  border: none;
  padding: 0;
  margin: 0;
}

a#lite-badge {
  display: none!important;
}

/* Botão do input */
.typebot-input .typebot-button {
  content: "";
  background: rgba(0, 138, 134, 1);
  border-radius: 50%; 
  position: relative;
  display: flex;
  align-items: center;
  justify-content: center;
  width: 50px; 
  height: 50px; 
  border: none;
  font-size: 0px;
  color: transparent;
}

.typebot-input .typebot-button::before {
  content: "";
  position: absolute;
  top: 50%;
  transform: translateY(-50%);
  width: 25px;
  height: 25px;
  background-repeat: no-repeat;
  background-size: cover;
  background-image: url('data:image/svg+xml;charset=utf8,<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 512 512" width="19px"><path d="M476.59 227.05l-.16-.07L49.35 49.84A23.56 23.56 0 0027.14 52 24.65 24.65 0 0016 72.59v113.29a24 24 0 0019.52 23.57l232.93 43.07a4 4 0 010 7.86L35.53 303.45A24 24 0 0016 327v113.31A23.57 23.57 0 0026.59 460a23.94 23.94 0 0013.22 4 24.55 24.55 0 009.52-1.93L476.4 285.94l.19-.09a32 32 0 000-58.8z" fill="white"/></svg>');
}

/* Oculta o ícone anterior*/
.typebot-input .typebot-button .send-icon {
  display: none; 
}

/* Estilo da caixa do input */
.typebot-input {
    max-width: 100%!important;
    width:100%!important;
    position: fixed;
    bottom: 0;
    align-items: center;
    z-index: 999;
    right: 0;
    margin-bottom: 20px;
    background-color: white;
    border-radius: 50px;
    box-shadow: 1 2px 1px -1px rgba(0,0,0,.2);
    height: 50px;
    padding-right: 0px!important;
}


/* Corrigir cor do botão */
.disabled\:opacity-50:disabled {
    opacity: 100%;
}
